"use client";

import clsx from "clsx";
import Link from "next/link";
import { usePathname } from "next/navigation";

const navItems = {
	"/": {
		name: "home",
	},
	"/buy-nextjs-themes": {
		name: "buy",
	},
	"/projects": {
		name: "projects",
	},
	"/portfolio": {
		name: "portfolio",
	},
	"/blog": {
		name: "blog",
	},
	"/contact": {
		name: "contact",
	},
};

function Logo() {
	return (
		<Link aria-label="Byron Wade" href="/">
			<svg
				xmlns="http://www.w3.org/2000/svg"
				xmlnsXlink="http://www.w3.org/1999/xlink"
				width="60"
				height="60"
			>
				<image
					width="60"
					height="60"
					x="0"
					y="0"
					xlinkHref="data:img/png;base64,"
				></image>
			</svg>
		</Link>
	);
}

export default function Navbar() {
	let pathname = usePathname();
	if (pathname.includes("/blog/")) {
		pathname = "/blog";
	}

	return (
		<aside className="md:w-[150px] md:flex-shrink-0 -mx-4 md:mx-0 md:px-0">
			<div className="lg:sticky lg:top-20">
				<div className="ml-2 md:ml-[12px] mb-2 px-4 md:px-0 md:mb-8 space-y-10 flex flex-col md:flex-row items-start ">
					<Logo />
				</div>
				<nav
					className="flex flex-row md:flex-col items-start relative overflow-scroll px-4 md:px-0 pb-0 fade md:overflow-auto scroll-pr-6 md:relative"
					id="nav"
				>
					<div className="flex flex-row md:flex-col space-x-0 pr-10 mb-2 mt-2 md:mt-0">
						{Object.entries(navItems).map(([path, { name }]) => {
							const isActive = path === pathname;

							return (
								<Link
									key={path}
									href={path}
									className={clsx(
										"transition-all hover:text-neutral-800 dark:hover:text-neutral-200 py-[5px] px-[10px]",
										{
											"text-neutral-500": !isActive,
											"font-bold": isActive,
										}
									)}
								>
									{name}
								</Link>
							);
						})}
					</div>
				</nav>
			</div>
		</aside>
	);
}
